import React from 'react'
import { NavLink } from 'react-router-dom'

const links = [
  {
    path:"/",
    title:"Home"
  },
  {
    path:"/whyharvest",
    title: "WhyHarvest"
  },
  {
    path:"/features",
    title: "Features"
  },
  {
    path:"/customers",
    title: "customers"
  },
  {
    path: "/login",
    title: "Login"
  }
]

function NavBar() {
  return (
    <>
      {/* add your links */}
      {links.map((link)=> (
        <NavLink key={link.path} to={link.path}>
          {link.title}
        </NavLink>
      ))}
    </>
  )
}

export default NavBar
